import axios from 'axios';

const appLogin = (username, password) => {
     const response = axios.post('http://localhost:5000/projects', {
          username: username,
          password: password
      })
      .then(response => {
          console.log(response)
      })
      .catch(error => {
          console.log(error)
      })
      console.log(response);
}

export default appLogin
